    [Parameter]
    public string id { get; set; }
    Area objarea = new Area();
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    string strMenu = "Area";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    private HubConnection hubConnection;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Error);
                //Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        objarea = areaservices.EditArea(Convert.ToInt64(id));
        StateHasChanged();
    }
    public async Task HandleValidSubmit()
    {
        if (strEdit == true)
        {
            var isCheck = areaservices.CheckAreaId(objarea.AreaName);
            if (isCheck == objarea.AreaId || isCheck == 0)
            {
                objarea.ModifyDate = DateTime.Now;
                areaservices.UpdateArea(objarea);
                Snackbar.Add("Saved Successfully.", Severity.Success);
                navManager.NavigateTo("arealist");
            }
            else
            {
                Snackbar.Add("Already Exists.", Severity.Info);
                navManager.NavigateTo("areaedit");
            }
        }
        else
        {
            Snackbar.Add("You dont have to privilege.", Severity.Error);
            navManager.NavigateTo("dashboard");
        }
    }
    void Cancel()
    {
        navManager.NavigateTo("arealist");
    }

